import React, { Component } from 'react';
import '../Styles/Profile.css';
import Navigation from '../Components/Navigation';
import Cities from '../static_resources/cities.png';
import Footer from '../Components/Footer';

class CityData extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <p></p>
        <h1>{this.props.city.name}</h1>
        <img src={Cities} class="cover-image" />
        <p></p>
        <h4>Median Age: {this.props.city.median_age}</h4>
        <h4>Median House Price: {this.props.city.house_price}</h4>
        <Footer />
      </div>
    );
  }
}

export default CityData;
